          <div className='heading'>
          <h1>  ToDo List</h1>
          </div>
          <div  className='input'>
          <input type="text" placeholder="add a item"/>
          </div>
          <div className='button'>
          <button>+</button>
          </div>



        </div>

      </div>
    
    </>
  );
};

export default App;
